import React from "react";
import "./style.css";
import { Col, Row } from "../Grid";
import { Input, FormBtn } from "../Form";
import { Panel } from 'react-bootstrap';

// This file exports both the List and ListItem components

export function Panels({ props}) {
  return (
    <div>
        <Row>
        <Col size="sm-12">
     <Panel bsStyle="danger">
     <Col size="sm-12">
        <Panel.Heading>
            <Panel.Title componentClass="h3">Search Books</Panel.Title>
        </Panel.Heading>
        </Col>
        <Panel.Body>
            <form>
      
            <Input size="sm-8" name="Search Books" placeholder="Books (required)" />
         

            <FormBtn size="sm-4">Search</FormBtn>

            </form>
        </Panel.Body>
    </Panel>
    </Col>
    </Row>
    </div>
  );
}

export default Panels;
